def normalizeRect(rect):

    x1, y1, x2, y2 = rect
    if x1 > x2:
        # swap
        x1, x2 = x2, x1
    if y1 > y2:
        # swap
        y1, y2 = y2, y1
    return (x1, y1, x2, y2)

def percentile(values,p):

    sorted_values = sorted(values)
    N = len(sorted_values) - 1
    rank = p / 100. * (N + 1)
    k = int(rank)
    d = rank - k
    if k == 0:
	    return sorted_values[0]
    elif k == N:
	    return sorted_values[-1]
    else:
	    return sorted_values[k-1] + d * (sorted_values[k] - sorted_values[k-1])

