def find_nth(s, sub, n, start=0, end=float('inf')):

    if not sub:
        raise ValueError('sep cannot be empty')
    if n < 1:
        raise ValueError('n must be at least 1')

    L = len(s)
    l = len(sub)
    count = 0
    i = start
    while i < min(end, L) - l + 1:
        if s[i:i+l] == sub:
            count += 1
            if count == n:
                return i
            i += l
        else:
            i += 1

    return -1

