def rfind_nth(s, sub, n, start=0, end=float('inf')):

    if not sub:
        raise ValueError('sep cannot be empty')
    if n < 1:
        raise ValueError('n must be at least 1')

    L = len(s)
    l = len(sub)
    count = 0
    i = min(L, end) - l
    while i >= start:
        if s[i:i+l] == sub:
            count += 1
            if count == n:
                return i
            i -= l
        else:
            i -= 1

    return -1

