def bkpt_scale(df, num_points, bkpt, heat_cool):


    dft = (
        df[df["temp_c"] <= bkpt].reset_index()
        if heat_cool == "heat"
        else df[df["temp_c"] >= bkpt].reset_index()
    )
    if len(dft) < num_points:
